import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';

const Signin = () => {
  const [formData, setFormData] = useState({ username: "" });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // You might want to perform additional actions here, such as authentication
  };

  return (
    <form onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in">
        <a href="/public">
          <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
        </a>
        <div className="nav_1">
          <div className="for-x">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
        </div>
        <div className="down-box">
          <div className="content">
            <h2>Enter Your Password</h2>
            <div className="lin_main">
              <label htmlFor="username">Phone, email, or username</label>
              <input
                className="input"
                type="text"
                name="username"
                id="username"
                onChange={handleChange}
                value={formData.username}
                required
              />
              <button type="submit" className="box_ nex">
                <a className="signf" href="/signflow">Next</a>
              </button>
              <div className="box_">Forgot password?</div>
              <div className="text">Don't have an account? <a href="/create">Sign Up</a></div>
            </div>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
}

export default Signin;
